import { Link } from "react-router-dom";
import ArrowBackIcon from '@material-ui/icons/ArrowBack';

const page4 = () => {
  return (
    <div className="pageWrap">
      <Link to="/page2" className="BackIcon"><ArrowBackIcon fontSize="large" /></Link>
     <h3>사진을 업로드해주세요.</h3>

<div className="downloadWrap"> <img src="img/download.png" width="100px" /> </div>  
<button>사진 업로드</button>   
<h4> <img src="img/sheck" /> 무늬가 없는 배경에서 촬영해주세요.</h4>





      <Link to="/page4"> <img src="img/arrow.png" className="frontarrow"/></Link>
    </div>
  );
};

export default page4;
